import './App.css';
import {Ride} from './components/Ride/Ride';
import 'bootstrap/dist/css/bootstrap.min.css';
import rides from './data/Ride';

function App() {
    return (
        <div className="App bg-dark">
            {rides
                .map(function (object, i) {
                    return <Ride ride={object} key={i}/>;
                })}

        </div>
    );
}

export default App;
